drop table if exists user_role;
drop table if exists user;

create table user_role (
	id numeric(1) primary key,
	name varchar(50) not null
);


create table user (
    id varchar(60) primary key,
    first_name varchar(100) not null,
    middle_name varchar(100) null,
    last_name varchar(100) not null,
    phone_number varchar(10) not null,
    updated timestamp not null default current_timestamp(),
    email varchar(254) unique not null,
    --These names are a little wordy on purpose to make it harder for an attacker to guess the field names via command line.
    sec_pw_hash binary(16) not null,
    sec_pw_salt binary(16) not null,
    user_role_id numeric(1),
    foreign key (user_role_id) references user_role(id)
);


